Sim, eu sou um "decepcionado"!

Eu vejo pessoas tentando o "jeitinho brasileiro" para ganhar dinheiro na internet;

Eu vejo pessoas discutindo pessoas e não ideias, na internet;

Eu vejo pessoas descartando amigos e parentes por opinião política, através da dicotomia entre Direita e Esquerda;

Eu vejo pessoas tentando fundamentar suas teorias sem nenhum embasamento científico;

Eu vejo pessoas tomando a picada não aprovada, completamente experimental, vinda da experiência já escrita no "Os Protocolos...";

Vejo pessoas venerando seus algozes e humilhando seus benfeitores;

Vejo pessoas desconfiando dos justos e sendo guiadas por cegos;

Vejo pessoas imorais, que apontam o cisco nos olhos de seus irmãos mas são incapazes de retirarem a trave de vossos olhos; 

Vejo pessoas hipócritas, que mentem dizendo serem pesquisadores da verdade mas são infiltrados em movimentos para destruir a própria verdade....

Eu vejo tudo isso...quando você vai enxergar?

Não tem como não se decepcionar.

Algumas premissas que ele adotou:
- Ser de direita;
- Ter nas redes sociais (Instagram e Facebook) postagens de apoio ao Bolsonaro; 
- Ele não colocou puxadores de voto que já considera eleito. Por que? Porque esses já estão eleitos! O que temos que dar voto são para aqueles do partido dele, a fim de que possam ser puxados pelo coeficiente eleitoral. (Nunca se perguntou por que Maria do Rosário e outros são eleitos mesmo tendo menos votos?);
- Ele também verificou quantos vezes o candidato votou a favor do Bolsonaro no portal Brasil em Foco (caso já tenha mandato);
- Ele também teve o saco de mandar e-mail perguntando sobre as políticas em caso de eleição. No caso de Brasília, ele foi no gabinete dos caras;
- No caso do RJ, ele tirou o Daniel Silveira, pois não acredita que o TSE vai deixá-lo assumir, mesmo ele sendo eleito.

